import styles from './github_link.module.scss';



export default function GithubLink(): JSX.Element {
    return (
        <div style={{ width: '100%', textAlign: "center" }} >
            <div className={styles.innerBox}><a href="https://github.com/angyuhang98/fhir-theranos" target="_blank"><img src={"./icons/github-black.svg"} ></img><div>Github</div></a></div></div>

    );

}
